import React from "react";

export default function Skills() {
  const skills = ["React", "JavaScript", "Node.js", "MongoDB", "CSS", "Git"];

  return (
    <section id="skills">
      <h2>Skills</h2>
      <ul style={{ display: "flex", gap: "10px", flexWrap: "wrap" }}>
        {skills.map((skill) => (
          <li
            key={skill}
            style={{
              padding: "8px 15px",
              border: "1px solid gray",
              borderRadius: "20px",
            }}
          >
            {skill}
          </li>
        ))}
      </ul>
    </section>
  );
}
